import React from "react";
import { Link } from "react-router-dom";

function Meniu(props) {
  return (
    <nav>
      <ul className={props.klase} style={props.stilius}>
        {props.komandos.map((komanda) => (
          <Link to={komanda.adresas}>
            <li>{komanda.pavadinimas}</li>
          </Link>
        ))}
      </ul>
    </nav>
  );
}

export default Meniu;
